CREATE DATABASE IF NOT EXISTS push;

USE push;

CREATE TABLE `user_address` (
                                `id` bigint NOT NULL AUTO_INCREMENT,
                                `user_uuid` binary(16) DEFAULT NULL,
                                `shop_user_id` int NOT NULL,
                                `version_id` int NOT NULL,
                                `first_name` varchar(255) NOT NULL,
                                `last_name` varchar(255) NOT NULL,
                                `address_line_1` varchar(255) NOT NULL,
                                `address_line_2` varchar(255) DEFAULT NULL,
                                `address_line_3` varchar(255) DEFAULT NULL,
                                `address_line_4` varchar(255) DEFAULT NULL,
                                `city` varchar(255) NOT NULL,
                                `state` varchar(255) DEFAULT NULL,
                                `zipcode` varchar(20) DEFAULT NULL,
                                `country` varchar(255) NOT NULL,
                                `contact_number` varchar(30) DEFAULT NULL,
                                `is_default` tinyint(1) NOT NULL,
                                `is_active` tinyint(1) NOT NULL,
                                `created_ts` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
                                `modified_ts` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
                                PRIMARY KEY (`id`),
                                KEY `idx$address$shop_user_id` (`shop_user_id`),
                                CONSTRAINT `fk$address$shop_user_id` FOREIGN KEY (`shop_user_id`) REFERENCES `user_woo_users` (`woo_user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2885345 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


CREATE TABLE `user_woo_users` (
                                  `id` int NOT NULL AUTO_INCREMENT,
                                  `user_id` int NOT NULL,
                                  `woo_user_id` int NOT NULL,
                                  `woo_autologin_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
                                  `session_id` binary(16) DEFAULT NULL,
                                  PRIMARY KEY (`id`),
                                  UNIQUE KEY `user_id` (`user_id`),
                                  KEY `woo_user_id` (`woo_user_id`),
                                  KEY `idx$user_woo_users$session_id` (`session_id`)
) ENGINE=InnoDB AUTO_INCREMENT=756739776 DEFAULT CHARSET=utf8mb3 COLLATE=utf8_unicode_ci;


CREATE TABLE `users` (
                         `id` int NOT NULL AUTO_INCREMENT,
                         `account_code` varchar(140) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Recurly Account Code (original sign-up email address)',
                         `password` char(64) COLLATE utf8_unicode_ci NOT NULL,
                         `salt` char(16) COLLATE utf8_unicode_ci NOT NULL,
                         `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `first_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `last_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `ship_address1` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `ship_address2` varchar(256) COLLATE utf8_unicode_ci NOT NULL,
                         `ship_city` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `ship_state` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `ship_zipcode` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `ship_country` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `ship_phone` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `phone` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
                         `order_date` datetime NOT NULL,
                         `user_agent` varchar(255) CHARACTER SET utf8 NOT NULL,
                         `selectmanual` int NOT NULL DEFAULT '0',
                         `shipping_flag` tinyint(1) DEFAULT '0',
                         `uuid` binary(16) DEFAULT NULL,
                         `date_created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
                         `date_modified` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
                         `created_ts` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
                         `modified_ts` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
                         `delete_privacy` tinyint(1) NOT NULL DEFAULT '0',
                         `is_public_user` tinyint DEFAULT NULL,
                         PRIMARY KEY (`id`),
                         UNIQUE KEY `email` (`email`),
                         UNIQUE KEY `uuid__unique` (`uuid`),
                         KEY `first_name_` (`first_name`),
                         KEY `last_name_` (`last_name`),
                         KEY `account_code` (`account_code`),
                         KEY `idx__ship_phone` (`ship_phone`),
                         KEY `idx__phone` (`phone`),
                         KEY `idx_users_mts` (`modified_ts`)
) ENGINE=InnoDB AUTO_INCREMENT=1000506774 DEFAULT CHARSET=utf8mb3 COLLATE=utf8_unicode_ci;


CREATE DATABASE IF NOT EXISTS shop;

USE shop;

CREATE TABLE `shop_usermeta` (
                                 `umeta_id` bigint unsigned NOT NULL AUTO_INCREMENT,
                                 `user_id` bigint unsigned NOT NULL DEFAULT '0',
                                 `meta_key` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
                                 `meta_value` longtext COLLATE utf8mb4_unicode_ci,
                                 PRIMARY KEY (`umeta_id`),
                                 KEY `meta_key` (`meta_key`(191)),
                                 KEY `IX_user_id_meta_key` (`user_id`,`meta_key`(191)),
                                 KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10303238 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `shop_users` (
                              `ID` bigint unsigned NOT NULL AUTO_INCREMENT,
                              `user_login` varchar(60) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
                              `user_pass` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
                              `user_nicename` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
                              `user_email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
                              `user_url` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
                              `user_registered` datetime NOT NULL,
                              `user_activation_key` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
                              `user_status` int NOT NULL DEFAULT '0',
                              `display_name` varchar(250) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
                              PRIMARY KEY (`ID`),
                              KEY `user_login_key` (`user_login`),
                              KEY `user_nicename` (`user_nicename`),
                              KEY `user_email` (`user_email`)
) ENGINE=InnoDB AUTO_INCREMENT=1919195777 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

